import axios from 'axios';

export const token = async () => {
    window.location.assign('http://localhost:8080/login')
}

export const exchangeToken = (token: string) => {
    console.log("token da decifrare: " + token)
    let url= 'http://localhost:8080/authAPI/v1/token'
    axios.post(url, {token: token})
        .then((response) => {
            console.log('qui decifrato:', response)
        });
}
